import {apiCall} from '../utils/apiCall'
import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Rodal from 'rodal';
import 'rodal/lib/rodal.css'

function Home() {
    const navigate = useNavigate();
    const [queues, setQueues] = useState([]);

    useEffect(()=>{
        getInProgressQueues();
    }, [])

    function getInProgressQueues(){
        apiCall('/queue/in-progress', 'get').then(res=>{
            setQueues(res.data)
        })
    }

    return (
        <div>
            <h1>Home page</h1>
            <button className='btn btn-info mx-2' onClick={()=>navigate('/register')}>Register now</button>
            <button className='btn btn-info mx-2' onClick={()=>navigate('/login')}>Login now</button>
            <table>
                <thead>
                    <tr>
                        <td>t/r</td>
                        <td>name</td>
                        <td>Queue Number</td>
                        <td>Queue Status</td>
                        <td>operator name</td>
                    </tr>
                </thead>
                <tbody>
                    {
                        queues.map(queue=> <tr>
                            <td>{queue.id}</td>
                            <td>{queue.name}</td>
                            <td>{queue.queueNumber}</td>
                            <td>{queue.queueStatus}</td>
                            <td>{queue.operator.fullName}</td>
                        </tr>)
                    }
                </tbody>
            </table>
        </div>
    )
}

export default Home;
